import React from 'react';
import { Layout } from './layout/Layout.js';

function Speaking() {
  return (
    <Layout>
      <div className="text-block-left small">
        <p>
          I've spoken at a number of different conferences and events over the last few years, including:
        </p>
        <ul>
          <li><strong>The Lead Dev Austin</strong> (December 2018): <a href="https://www.youtube.com/watch?v=34tLTZgvOxM&list=PLBzScQzZ83I8aBUZtZXNWZkWKEgWRffH6&index=12&t=0s&app=desktop">How to Get Away with Refactoring</a></li>
        </ul>
      </div>
    </Layout>
  );
}

export default Speaking;
